const stockMarketData = [
	{ stockName: 'Apple', ticker: 'AAPL', startingPrice: 20, priceRange: 50 },
	{ stockName: 'Tesla', ticker: 'TESL', startingPrice: 20, priceRange: 50 },
	{ stockName: 'Facebook', ticker: 'FB', startingPrice: 50, priceRange: 100 },
];

export default stockMarketData;
